// src/pages/BestSellers.js
import React from 'react';
import './Bestsellers.css';

const BestSellers = () => {
  return (
    <div className="best-sellers">
      <h1>Best Sellers</h1>
      <CardSection heading="Best Sellers" link="/best-sellers" />
    </div>
  );
};

export default BestSellers;
